import { Iallinfo } from "./domain/all_info";
import Vehicle from "./vehicle";
const geo_flag =
  "data:image/png;base64,";
const Vehicle_container: React.FC<Iallinfo> = ({
  product_lst,
  models,
  cat_lst,
  manufacturers,
  loaded_pages,
  on_page,
  change_onpage,
  setnewapi_and_fetch,
  doeverything,
}) => {
  function pageChangeHandler() {}

  return (
    <div className="vehicle_container">
      {product_lst.map((prod) => {
        const piclink =
          "https://static.my.ge/myauto/photos/" +
          prod.photo +
          "/thumbs/" +
          prod.car_id +
          "_1.jpg?v=" +
          prod.photo_ver;
        const price_checker = prod.has_predicted_price
          ? Math.round(prod.predicted_price)
          : prod.price_value;
        const price = price_checker === 0 ? prod.price_value : price_checker;
        const release_year = String(prod.prod_year);
        const distance = String(prod.car_run_km);
        const engine_vol = String(prod.engine_volume / 1000);
        const goodcond = prod.conditioner
          ? prod.condition_type_id === 0
            ? false
            : true
          : false;
        const side = prod.right_wheel ? "მარჯვნივ" : "მარცხნივ";
        const manufac = manufacturers.find(
          (obj) => obj.man_id === String(prod.man_id)
        );
        const name_extension1 = models.find(
          (obj) => obj.model_id === prod.model_id
        );
        const name_extension2 = cat_lst.find(
          (obj) => obj.category_id === prod.category_id
        );
        const namee =
          manufac?.man_name +
          "  " +
          (name_extension1 ? name_extension1.model_name : "") +
          (name_extension2 ? name_extension2.seo_title : "");

        return (
          <Vehicle
            image={piclink}
            name={String(namee)}
            release_year={release_year}
            engine={engine_vol + " dat. hybridao"}
            distance={distance + " km"}
            type={"automatic"}
            side={side}
            price={price}
            location={"samargalo"}
            gambajebadi={false}
            flag={geo_flag}
            gambajeba_price={1345}
            gambajebulia={false}
            views={prod.views}
            uploaded={"2 დღის წინ"}
            adds={""}
            vip={2}
            test_drive={true}
            isnew={true}
            cleanhistory={true}
            goodcond={goodcond}
            saswrafod={true}
            verified={true}
          />
        );
      })}

      <div>
        <button onClick={() => doeverything(on_page, 1, product_lst)}>
          პირველ გვერდზე დაბრუნება
        </button>
        <button onClick={() => doeverything(on_page, on_page - 1, product_lst)}>
          {" "}
          &lt;{" "}
        </button>
        <button onClick={() => doeverything(on_page, on_page + 1, product_lst)}>
          {" "}
          &gt;{" "}
        </button>
      </div>
    </div>
  );
};

export default Vehicle_container;
